import ReturndAte from './Date';
import ReturnName from './Name';
import Media from 'react-media';
import ReturnPriX from './Prix';
import ReturnUnite from './Unite';
import './Box.css';

// Return Box Actif
export default function ReturnActifBox() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-boxactif-dash'>
  <ViewText />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-boxactif-dash-sm'>
  <ViewText />
 </div>
);
export const ViewText = () => (
 <>
  <ReturndAte />
  <ReturnName />
  <ReturnPriX />
  <ReturnUnite />
 </>
);
